import ReactDOM from 'react-dom'

const Todo = ({task}) => {
    return (
        <div className="Todo">
            <p>
                <input type="checkbox" />
                <label for="task">{task.task}
                    <a></a>
                    <button type="button">-</button>
                </label>

            </p>
        </div>
    )
}


export default Todo
